import React from 'react';
import Header from './Header';
import MainContent from './MainContent';
import Footer from './Footer';
import './App.css'; // 스타일 파일

const App = () => {
  return (
    <div id="wrap">
      <Header />
      <MainContent />
      <Footer />
    </div>
  );
};

export default App;
